import './App.css';
import InputToDo from "./components/InputToDo";
import AllItems from "./components/AllItems";

interface AppName {
    name: string;
}

function App({name}: AppName) {
    return (
        <div className="App">
            <h1>{name}</h1>
            <InputToDo name='What needs to be done?'/>
            <AllItems/>
        </div>
    );
}

export default App;
